import React from 'react'
import { Link } from 'react-router-dom';
import './Group.css';

const Group = (props) => {
    return (
        <div>
            <div className="group">
                <span className="groupTitle">
                
                   <Link className="link" to={`/group/${props.id}`} > {props.title} </Link>
                </span>
                <hr />
                <div className="groupMeta">
                    <span className="groupdate">  {new Date(props.updated_at).toDateString()}</span>
                    <span className="groupdate">  ~{props.username}</span>
                </div>

            <p className="groupdesc">
                {props.message}
            </p>

            </div>
        </div>
    )
}

export default Group
